// src/pages/Dashboard.jsx

import React, { useState, useEffect } from "react";
import Header from "../components/Header"; // Import the Header

function Dashboard() {
  const [activeTourists, setActiveTourists] = useState(1247);
  const [issuedIDs, setIssuedIDs] = useState(8934);
  const [currentIncidents, setCurrentIncidents] = useState(12);
  const [openSOS, setOpenSOS] = useState(3);

  useEffect(() => {
    // Simulation logic remains the same
    const interval = setInterval(() => {
      setActiveTourists((prev) => prev + Math.floor(Math.random() * 3) - 1);
      // ... other state updates
    }, 5000);
    return () => clearInterval(interval);
  }, []);

  return (
    <div style={styles.pageBackground}>
      {/* RENDER THE HEADER HERE */}
      <Header />

      <div style={styles.mainContentWrapper}>
        {/* Statistics Cards */}
        <div style={styles.statisticsContainer}>
            {/* All your stat cards and dashboard content go here */}
            <div style={styles.statCard}>
                {/* ... content of the first stat card ... */}
            </div>
            {/* ... other cards ... */}
        </div>

        {/* Main Content Grid with Map and Feed */}
        <div style={styles.mainContentGrid}>
            {/* ... map card ... */}
            {/* ... feed and quick actions ... */}
        </div>
      </div>
    </div>
  );
}

// All the styles for the Dashboard page go here
const styles = {
    pageBackground: {
        fontFamily: "'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif",
        backgroundColor: '#e9eff6',
        minHeight: '100vh',
    },
    mainContentWrapper: {
        maxWidth: '1400px',
        margin: '0 auto',
        padding: '30px 20px',
    },
    statisticsContainer: {
        display: 'grid',
        gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
        gap: '20px',
        marginBottom: '30px',
    },
    statCard: {
        backgroundColor: '#ffffff',
        borderRadius: '12px',
        padding: '25px',
        boxShadow: '0 4px 10px rgba(0, 0, 0, 0.08)',
    },
    // ... include all the other necessary styles for your dashboard cards, map, etc.
};

export default Dashboard;
